import React, { useRef } from 'react';
import { useFrame } from '@react-three/fiber';
import { Float, Text, Box, Sphere, Torus, Cone, Cylinder } from '@react-three/drei';

// DevOps Icon Component
function DevOpsIcon({ position, icon, color, shape = 'box' }) {
  const meshRef = useRef();

  useFrame((state) => {
    if (meshRef.current) {
      meshRef.current.rotation.x += 0.005;
      meshRef.current.rotation.y += 0.005;
    }
  });

  const renderShape = () => {
    switch (shape) {
      case 'sphere':
        return <Sphere ref={meshRef} args={[0.4, 32, 32]}><meshStandardMaterial color={color} wireframe /></Sphere>;
      case 'cylinder':
        return <Cylinder ref={meshRef} args={[0.3, 0.3, 0.6, 32]}><meshStandardMaterial color={color} wireframe /></Cylinder>;
      case 'cone':
        return <Cone ref={meshRef} args={[0.4, 0.7, 32]}><meshStandardMaterial color={color} wireframe /></Cone>;
      case 'torus':
        return <Torus ref={meshRef} args={[0.4, 0.15, 16, 32]}><meshStandardMaterial color={color} wireframe /></Torus>;
      default:
        return <Box ref={meshRef} args={[0.6, 0.6, 0.6]}><meshStandardMaterial color={color} wireframe /></Box>;
    }
  };

  return (
    <Float speed={1.5 + Math.random()} rotationIntensity={0.5} floatIntensity={2}>
      <group position={position}>
        {renderShape()}
        <Text
          position={[0, -0.7, 0]}
          fontSize={0.2}
          color={color}
          anchorX="center"
          anchorY="middle"
          font="/fonts/Inter-Bold.woff"
        >
          {icon}
        </Text>
      </group>
    </Float>
  );
}

// Particle System for CI/CD Pipeline Effect
function ParticleField() {
  const particlesRef = useRef();
  const particleCount = 100;

  const positions = new Float32Array(particleCount * 3);
  for (let i = 0; i < particleCount; i++) {
    positions[i * 3] = (Math.random() - 0.5) * 20;
    positions[i * 3 + 1] = (Math.random() - 0.5) * 20;
    positions[i * 3 + 2] = (Math.random() - 0.5) * 20;
  }

  useFrame((state) => {
    if (particlesRef.current) {
      particlesRef.current.rotation.y += 0.0005;
    }
  });

  return (
    <points ref={particlesRef}>
      <bufferGeometry>
        <bufferAttribute
          attach="attributes-position"
          count={particleCount}
          array={positions}
          itemSize={3}
        />
      </bufferGeometry>
      <pointsMaterial size={0.05} color="#00d4ff" transparent opacity={0.6} />
    </points>
  );
}

function Scene3D() {
  const groupRef = useRef();

  useFrame((state) => {
    if (groupRef.current) {
      groupRef.current.rotation.y += 0.0005;
    }
  });

  return (
    <>
      <ambientLight intensity={0.4} />
      <pointLight position={[10, 10, 10]} intensity={1} color="#00d4ff" />
      <pointLight position={[-10, -10, -10]} intensity={0.5} color="#ff6b6b" />
      <spotLight position={[0, 10, 0]} angle={0.3} penumbra={1} intensity={0.5} color="#4ecdc4" />

      <group ref={groupRef}>
        {/* Kubernetes - Blue Hexagon */}
        <DevOpsIcon position={[-4, 2, -2]} icon="K8s" color="#326CE5" shape="sphere" />

        {/* Docker - Blue Whale */}
        <DevOpsIcon position={[4, 2, -1]} icon="Docker" color="#2496ED" shape="box" />

        {/* Jenkins - Red/Orange */}
        <DevOpsIcon position={[-3, -2, -3]} icon="Jenkins" color="#D24939" shape="cylinder" />

        {/* Git - Orange */}
        <DevOpsIcon position={[3, -2, -2]} icon="Git" color="#F05032" shape="torus" />

        {/* GitHub - Purple */}
        <DevOpsIcon position={[-5, 0, -4]} icon="GitHub" color="#6e5494" shape="sphere" />

        {/* ArgoCD - Orange/Red */}
        <DevOpsIcon position={[5, 0, -3]} icon="ArgoCD" color="#EF7B4D" shape="cone" />

        {/* Linux - Yellow */}
        <DevOpsIcon position={[0, 3, -5]} icon="Linux" color="#FCC624" shape="sphere" />

        {/* Terraform - Purple */}
        <DevOpsIcon position={[-2, -3, -1]} icon="Terraform" color="#7B42BC" shape="box" />

        {/* AWS - Orange */}
        <DevOpsIcon position={[2, 3, -3]} icon="AWS" color="#FF9900" shape="cylinder" />

        {/* Ansible - Red */}
        <DevOpsIcon position={[0, -1, -6]} icon="Ansible" color="#EE0000" shape="torus" />
      </group>

      <ParticleField />

      {/* Connecting Lines Effect */}
      <mesh position={[0, 0, -4]}>
        <torusGeometry args={[3, 0.02, 16, 100]} />
        <meshBasicMaterial color="#00d4ff" transparent opacity={0.3} />
      </mesh>

      <mesh position={[0, 0, -4]} rotation={[Math.PI / 2, 0, 0]}>
        <torusGeometry args={[2.5, 0.02, 16, 100]} />
        <meshBasicMaterial color="#4ecdc4" transparent opacity={0.3} />
      </mesh>
    </>
  );
}

export default Scene3D;
